import React from 'react'
import ShowVideoList from '../showVideoList/ShowVideoList'

function WHLvideoList({page,videoList}) {
  return (
    <>
    {
        videoList?.map(m=>{
            return(
                <div key={m?._id}>
                <ShowVideoList videoId={m?._id} />
                </div>
            )
        })
    }
    </>
  )
}

export default WHLvideoList
